$(document).ready(function() {
  console.log("custom js file loaded");
  window.showNew = function() {
    $('#new').fadeIn();
    $('#but').fadeOut();
  }
  window.hideNew = function() {
    $('#new').fadeOut();
    $('#but').fadeIn();
  }

  window.changeSelect = function() {
    var e = $('#project_id option:selected').text();
    $('#proj_text').text(e);
  }
});
